import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { Text, View, StyleSheet, ScrollView, TextInput, Button, TouchableOpacity, Image, ImageBackground } from 'react-native';

class SelectService extends React.Component {

    render() {
        const navigation = this.props.navigation;
        return (
            <ImageBackground
                style={{
                    width: "100%",
                    height: "100%"
                }}
                resizeMode={'cover'}
                source={require('../assets/bg.png')}
            >
                <ScrollView>
                    <View style={styles.container}>
                        <Image
                            style={{
                                width: 140,
                                height: 140,
                                marginTop: 26
                            }}
                            resizeMode={'cover'}
                            source={require('../assets/app-icon.jpg')}
                        />

                        <Text
                            style={{
                                fontSize: 18,
                                marginBottom: 8,
                                marginTop: 16,
                                fontWeight: 'bold'
                            }}>Select Service</Text>

                        <ImageBackground
                            style={{
                                width: "94%",
                                height: 150,
                                marginTop: 26,
                                borderRadius: 8
                            }}
                            resizeMode={'cover'}
                            source={require('../assets/pic_self_care.png')}
                        >
                            <View style={{
                                alignItems: 'center',
                                height: "100%",
                                marginStart: 16,
                                flexDirection: "row",
                            }}>
                                <CheckBox
                                    style={{
                                        width: 40,
                                        height: 40,
                                        padding: 10
                                    }}
                                // onClick={() => {
                                //   this.setState({
                                //     isChecked: !this.state.isChecked
                                //   })
                                // }}
                                // isChecked={this.state.isChecked}
                                // leftText={"CheckBox"}
                                />
                                <Text style={{
                                    color: "#FFF"
                                }}>Self Care</Text>
                            </View>
                        </ImageBackground>

                        <ImageBackground
                            style={{
                                width: "94%",
                                height: 150,
                                marginTop: 26,
                                borderRadius: 8
                            }}
                            resizeMode={'cover'}
                            source={require('./assets/pic_car_care.png')}
                        >
                            <View style={{
                                alignItems: 'center',
                                height: "100%",
                                marginStart: 16,
                                flexDirection: "row",
                            }}>
                                <CheckBox
                                    style={{
                                        width: 40,
                                        height: 40,
                                        padding: 10
                                    }}
                                // onClick={() => {
                                //   this.setState({
                                //     isChecked: !this.state.isChecked
                                //   })
                                // }}
                                // isChecked={this.state.isChecked}
                                // leftText={"CheckBox"}
                                />
                                <Text style={{
                                    color: "#FFF"
                                }}>Car Care</Text>
                            </View>
                        </ImageBackground>

                        <View style={[{
                            width: "94%",
                            marginStart: 10,
                            marginEnd: 10,
                            marginTop: 24,
                            marginBottom: 56,
                            backgroundColor: "#FFFFFF",
                            borderRadius: 4,
                        }]}>
                            <Button
                                title="Continue"
                                color="#00C8E4"
                                onPress={() =>
                                    navigation.navigate('ForgotPassword', { name: 'Jane' })
                                }
                            >
                                <Text style={{
                                    color: "#444"
                                }}></Text>
                            </Button>
                        </View>
                        <StatusBar style="auto" />
                    </View>
                </ScrollView>
            </ImageBackground >
        );
    }
}

export default SelectService;

const styles = StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
    backgroundColor: '#FFFFFF',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 66,
    height: 58,
  },
  buttonContainer: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
  },
  checkboxContainer: {
    flexDirection: "row",
    marginBottom: 20,
  },
  textHeading: {
    width: '47%',
    fontSize: 18,
    marginStart: 16,
    marginBottom: 16,
    marginTop: 32,
    fontWeight: 'bold'
  },
  textLabel: {
    textAlign: 'left',
    marginStart: 8,
    marginBottom: 8,
    color: '#4D4D4D',
    marginTop: 16,
    fontWeight: 'bold',
    width: "94%",
  },
  textInput: {
    height: 40,
    width: "94%",
    padding: 10,
    borderRadius: 4,
    borderColor: 'gray',
    backgroundColor: '#FFFFFF',
    borderWidth: 1,
  },

  buttonStyle: {
    width: "46%",
    marginEnd: 8,
    backgroundColor: "#00C8E4",
    borderRadius: 40,
  },
  buttonStyleWhite: {
    width: "46%",
    marginEnd: 8,
    backgroundColor: "#E6E6E6",
    borderRadius: 40,
  },
  containerList: {
    width: "100%",
    marginTop: StatusBar.currentHeight || 0,
  },
  item: {
    backgroundColor: '#FFFFFF',
    padding: 8,
    width: "92%",
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 8,
    marginVertical: 8,
    marginHorizontal: 16,
  },
  title: {
    fontSize: 32,
  },
  textBorder: {
    width: "50%",
    fontSize: 11,
    color: '#333333',
    fontWeight: 'bold',
    marginTop: 4,
    marginEnd: 4,
    marginStart: 4,
    borderRadius: 4,
    borderColor: '#E6E6E6',
    borderWidth: 1, padding: 4
  },
});
